import React, { Component, Children } from 'react';
import { Menu } from 'antd';

const AppLayout = () =>{
    return(
        <div>
            <Menu>
              <Menu.Item kew="home">nodebird</Menu.Item>  
            </Menu>
            {Children}
        </div>
    )
}

export default AppLayout;
